8	Nor' Easter	nor-easter	photos/NorEaster_-_2000.jpg					H	\N	f	t	2026-01-14 02:02:33.79281+00	2026-01-14 02:02:33.792822+00	1	\N	\N
4	Calm Seas	calm-seas	photos/CalmSeas-2000_gIFjZ58.jpg	photos/thumbnails/CalmSeas-600_hyGsAld.jpg	This photo was taken aboard the F/V Mary Elizabeth while fishing for fluke between Montauk and Block Island. It was an incredibly calm day, but just a few days later, we rode out a tropical storm, stern-to, for three days as we headed south. On this trip, we were catching a limit of fluke for North Carolina. While you can catch the fish anywhere, they must be landed in specific states. So, even though we were fishing off the coast of New York, we had to steam all the way down to North Carolina to offload the catch.\r\n\r\nIt’s not uncommon for boats in New York to buy out-of-state permits, as New York doesn’t allow fishing vessels to land any significant amount of fish other than squid. This forces boats to travel great distances to land finfish. These permits are extremely expensive, and the rising cost of doing business is crushing many fishermen’s livelihoods.			H	\N	f	t	2026-01-13 02:23:55.038507+00	2026-01-14 01:52:52.799303+00	1	\N	\N
5	Beaufort Shrimp Boats	beaufort-shrimp-boats	photos/Beaufort-2000.jpg	photos/thumbnails/Beaufort-600.jpg	After spending a few days rocking around in the wind and swells of the Atlantic, we finally rounded Cape Hatteras. From there, we changed course towards Cape Lookout, and after a night at anchor, we entered Beaufort Harbor. We tied up at Fultures Dock the next day and spent the entirety of it offloading fluke from our fully loaded fish hold. The Fultures have a fleet of pristine 90-foot shrimp boats, which are also equipped for catching sea scallops.\r\n\r\nI believe we were leaving on the *Mary Elizabeth* when this photo was taken. We had a three-day steam back home. On the way down, we got caught in a tropical storm. With the wind on our stern, we made great time, but on the way back, we had to beat into it, which slowed us down considerably. We were so close to the Gulf Stream that flying fish were everywhere. One night on watch, I stepped onto the deck, and a flying fish landed in a fish basket. I didn’t realize we were already in tropical waters, so it caught me by surprise.			H	\N	f	t	2026-01-14 01:55:25.179967+00	2026-01-14 01:55:25.179979+00	1	\N	\N
6	Buoy-8	buoy-8	photos/Buoy-8-2000.jpg	photos/thumbnails/Buoy-8-600_P7e33FJ.jpg	I took this photo, "Buoy 8," from my small shellfish boat. While I spent most of my time offshore on large fishing vessels, I would often spend my off-time on Shinnecock Bay. I had rebuilt an old 19 ft Mako for commercial clamming and bay scalloping, customizing it to make manual shellfish gathering more efficient. Using mechanical means is forbidden to protect the shellfish population, so everything is done the old-school way.\r\n\r\nClamming and scalloping are physically demanding. For clamming, boats drift with the wind and tide, while the fishermen pull a rake head through the mud, gathering clams in the rake as they drift. The clams are then pulled up from the bottom with an attached aluminum pole. The work is exhausting, as you're exposed to the elements, engaged in hard manual labor. Once sorted and bagged, the clams are brought to market fresh.\r\n\r\nBay scallop season opens in November. For scalloping, custom dredges are dragged behind the boat, gathering scallops as the boat spirals around. The dredges are pulled from the bottom to the cull board, where undersized scallops and those without a yearly growth ring are discarded, helping to maintain the population. \r\n\r\nIn recent years, however, "Red Tide" has decimated the shellfish stock. Nitrate runoff and pollution have fueled the die-off, devastating what was once a plentiful population of wild Long Island bay scallops.			H	\N	f	t	2026-01-14 01:57:49.57833+00	2026-01-14 01:57:49.578343+00	1	\N	\N
9	Portside	portside	photos/Portside-2000_6XDitbh.jpg	photos/thumbnails/Portside-600_gjz1zBR.jpg				H	\N	f	t	2026-01-14 02:04:36.883576+00	2026-01-14 02:04:36.883591+00	1	\N	\N
10	Steaming	steaming	photos/Steaming-2000.jpg	photos/thumbnails/Steaming-600.jpg	Taken in 2017 during a tropical storm, we were aboard the *Mary Elizabeth* steaming down to Beaufort, North Carolina with a limit of fluke we’d caught off the coast of—well, it doesn’t matter. I was on watch in the wheelhouse while my friend Scott Berglin and his father were sleeping. It took me three hours in driving rain to capture this shot. I was soaked, and so was my camera. I waited patiently for the perfect wave to hit the side of the boat and rear up. The wind and waves were on our stern, helping us make great time down to Virginia. I still remember how excited I was when we hit 10 knots that night.\r\n\r\nGoing through rough weather is something I’ve always enjoyed—even though it makes work tough, it brings a sense of wonder and excitement. You realize how powerless you are out on the great sea, at the mercy of mother nature.			H	\N	f	t	2026-01-14 02:06:18.272911+00	2026-01-14 02:06:18.272924+00	1	\N	\N
