29	Linh Phuoc Pagoda	linh-phuoc-pagoda	photos/Linh_Phuoc_Pagoda_-_2000_X5jR02n.jpg	photos/thumbnails/Linh_Phuoc_Pagoda_-_600.jpg	Linh Phuoc Pagoda is located about 8 km from Da Lat, a city in the central highlands of Vietnam. Da Lat itself sits at around 5,000 feet, making it much cooler than the coastal regions. The city is surrounded by beautiful pine trees and is fittingly called "The City of Eternal Spring." It's a major agricultural area, and one of the cool tourist spots we visited was a tea field. The area is also dotted with flower fields, making it a pretty scenic place. Riding my scooter, I saw flowers at nearly every turn—a peaceful break from the hustle and bustle of Vietnam's coastal areas.\r\n\r\nI had arrived in Ho Chi Minh City a week or two earlier, and that place can hit you with serious culture shock. The streets are jam-packed with men and women on scooters, people everywhere, making it overwhelming for someone like me, who's more used to wide open spaces. Even crossing the street feels like an impossible task at first. But with a bit of nerve and determination, I learned that once you step off the curb, the scooters magically weave right around you.\r\n\r\nAnd, of course, when you're in Asia, you've got to get yourself a scooter and start exploring. There’s so much to see just cruising down the road. I remember being in Vung Tau when I first witnessed something that defied the laws of physics. A man was riding a scooter with two massive—I'm talking 4-foot-tall—handcrafted and painted clay vases strapped to either side of his bike. He had no problem navigating the crowded and chaotic streets. It was a miracle that he was managing without shattering those glossy masterpieces. You see things like this all over the place here. Apparently, you can carry just about anything on a scooter—bags of vegetables, enough groceries for a family of ten, ornamental orange trees, handcrafted marble statues—you name it.\r\n\r\nThis was all news to me, but it’s exactly why I was there. This being my first extended overseas trip, I soaked up all the cultural differences.			V	\N	f	t	2026-01-14 23:05:33.97644+00	2026-01-14 23:30:39.721478+00	5	2000	1500
7	Mary Elizabeth	mary-elizabeth	photos/MaryElizabeth-BW-2000.jpg	photos/thumbnails/MaryElizabeth-BW-600.jpg	"Mary Elizabeth" was taken on an average day somewhere in the North Atlantic. The rusty net reel and gunnels have since been replaced, and this photo serves as the last vestige of that moment in my life. Like most other seemingly uneventful days, details fade and dissolve with time, eventually lost forever. But I’m lucky enough to have it immortalized in this image. While progress has replaced much of the back of the boat—the net reel, the gunnels—I’m grateful for this snapshot of my past. Fishing was something I thought I’d always be able to do; I could have never guessed what destiny had in store. And because of that, I’m more appreciative of memories like these and the nostalgia that comes with time spent at sea.\r\n\r\nLooking at this photo, a wave of nostalgia hits, bringing back happy images and short clips from the past. Little moments that seemed unimportant at the time are now priceless pieces of my personal history. Like learning to cook over-easy eggs for the first time, finally mastering it on the skillet while the boat rocked. I can still see myself handing a paper plate with one perfectly cooked egg on a piece of toasted white bread up the galley steps to the captain. We had backyard eggs—it was a big deal. Another memory flickers: I’m on the deck of the *Mary Elizabeth*, off the shores of Nantucket. It’s July. It’s hot. We’re on day four of a very unsuccessful fishing trip. A large boulder sits in the middle of the fish pen—a boulder where a pile of fish should be, marking the end of the trip and sinking morale. I remember the boat speeding toward port in defeat, the wind offering a small relief from the oppressive heat.\r\n\r\n I’m at the dock, hiding behind my sunglasses, still half-cocked from the night before. I catch a bucket and lower it into the fish hold, banging against the steel as it descends to the man sent by the squid processor. I signal, then haul up the now-loaded squid barrel. Cigarette smoke wafts by as I push the bucket toward Scott, who’s up on the dock catching and dumping it into a big hopper, briny salt water spilling out. His father operates the boom, and we work in sync with signals and body language. The scene is noisy, machines humming all around.\r\n\r\nThat summer, I didn’t bother installing an air conditioner, so I got used to sleeping naked. One morning, I woke up for work, still drunk and naked from the night before, assuming no harm, no foul. But weeks later, I learned I had climbed into my bunk completely nude and—well, there’s no polite way to put this—ended up dangling my balls in the captain’s face as I clambered up. Just a drunken accident, but still... not exactly a highlight. We laugh about it to this day. Years later, we’re still cracking up about the adventures at George’s seaside restaurant. I spent many warm summer nights there—and a few cold winter ones too, but that was years later on a different boat, at a different time. Same restaurant, though, but with no hangovers and a much bigger boat. Maybe a story for another time.			H	\N	f	t	2026-01-14 02:00:55.127956+00	2026-01-16 23:24:53.108715+00	1	1333	2000
34	Viking Pride	viking-pride	photos/Viking-Pride-2000_q0B7nsS.jpg	photos/thumbnails/Viking-Pride-600_hdpRVmi.jpg				V	\N	f	t	2026-01-18 19:09:37.447998+00	2026-01-18 19:20:15.584016+00	1	2000	1333
